import {useState, useEffect} from 'react';

function VideoSlide(){
    useEffect(function(){
        let slideStart = 0;
        let slideNum = 5;
        let dataId ='jobfind';
        let imgSrc = process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail';
        let prev= document.querySelector('.slideWrap .prev');
        let next= document.querySelector('.slideWrap .next');
        let slideArea = document.querySelector('.slideArea');
        let slide = slideArea.querySelectorAll('.slide');
        let child = slide[0];

        slideArea.appendChild(child);


        let startmouseX;
        let curmouseX;
        let mouse = false;
        let num;
        let originTranslateX;

        slideArea.addEventListener('mousedown',function(evt){
            evt.preventDefault();
            mouse = true;
            console.log('down'+mouse);
            startmouseX = evt.clientX;
            console.log(startmouseX);
            originTranslateX = parseFloat(slideArea.style.transform);

        })
        slideArea.addEventListener('mousemove',function(evt){
            evt.preventDefault();
            if(mouse == true){
                console.log('move'+mouse);
            curmouseX = evt.clientX;
            // console.log(curmouseX);
            num = curmouseX-startmouseX;
            slideArea.style.transform= 'translateX('+originTranslateX+num+'px)';
            console.log(originTranslateX+num);
            }
        })
        slideArea.addEventListener('mouseup',function(evt){
            evt.preventDefault();
            mouse = false;
            console.log('up'+mouse);
            if(num > 50){

            }else if(num < -50){

            }else{

            }
        })
        slideArea.addEventListener('mouseleave',function(){
            mouse = false;
            console.log('leave'+mouse);
        })

        function slidePrev(){

        }
        function slideNext(){
            
        }
        

    },[])
    return(
        <section className="VideoSlide">
            <div className="maintab">
                <h1 className='title'>
                    취업 교육 동영상
                </h1>
                <div className="select">
                    <button className="onepoint on"></button>
                    <button className="chippo"></button>
                </div>
            </div>
            <div className="subtab">
                <button className='subBtn on' data-id="prepare">취업준비</button>
                <button className='subBtn' data-id="resume">서류전형</button>
                <button className='subBtn' data-id="test">필기시험</button>
                <button className='subBtn' data-id="interview">면접전형</button>
            </div>
            <div className="slideWrap">
                    <div className="slideArea">
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind01.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind02.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind03.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind04.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind05.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind06.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind01.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind02.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind03.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind04.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind05.png'} alt="" /></a>
                        <a className="slide" href=""><img src={process.env.PUBLIC_URL+'/images/video/thumbnail/video_thumbnail_jobfind06.png'} alt="" /></a>
                    </div>
                    <div className="prev"></div>
                    <div className="next"></div>
            </div>
        </section>
    )
}

